window.bookSummaryJSON = "<p><b>Who sends cat pictures in a dating app?</b></p> <p>When dragon shifter billionaire Damian Blackwood is pressured into testing his new company’s dating app, the last thing he expects is to find is an actual connection....</p> <p>Weird work hours make normal dating near impossible for Nurse Andi. When a colleague recommends a new dating app, Andi signs on for some fun, never thinking it would go far….</p> <p>Can you begin falling for someone you’ve never seen? And who has only sent you cat pictures?<br> <br> <i>A Prince of the Otherworlds </i>prequel short story!</p>"; 
